INSERT INTO `tongue_diagnosis` VALUES (18, 8, '/uploads/tongue/773d1d1b-f44e-4338-ae60-4584c36ddeb0.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌色淡红鲜明，舌体大小适中，形态正常，舌面湿润，舌苔薄白且能透见舌质。根据中医舌诊理论，此为典型的正常舌象，反映脏腑功能正常，气血调和，营卫协调。舌色淡红表明气血充盈，舌面湿润提示津液未伤，苔薄白则说明病邪未侵或病邪尚轻。整体来看，此舌象未见明显病理特征，属于健康状态。', '1. 饮食建议：维持均衡饮食，多食用山药、大枣、薏米等健脾益气的食物，避免生冷寒凉及过于油腻甜腻的食物。2. 中药方剂：无需特殊用药，可适当服用四君子汤以巩固脾胃功能，保持气血充足。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行。4. 情志调节：保持心情舒畅，避免过度思虑或情绪波动，有助于维持脏腑平衡。5. 定期观察：建议定期自我观察舌象变化，若出现异常舌象应及时就医。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"该舌象表现为舌色淡红鲜明，舌体大小适中，形态正常，舌面湿润，舌苔薄白且能透见舌质。根据中医舌诊理论，此为典型的正常舌象，反映脏腑功能正常，气血调和，营卫协调。舌色淡红表明气血充盈，舌面湿润提示津液未伤，苔薄白则说明病邪未侵或病邪尚轻。整体来看，此舌象未见明显病理特征，属于健康状态。\",\n  \"suggestions\": \"1. 饮食建议：维持均衡饮食，多食用山药、大枣、薏米等健脾益气的食物，避免生冷寒凉及过于油腻甜腻的食物。2. 中药方剂：无需特殊用药，可适当服用四君子汤以巩固脾胃功能，保持气血充足。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行。4. 情志调节：保持心情舒畅，避免过度思虑或情绪波动，有助于维持脏腑平衡。5. 定期观察：建议定期自我观察舌象变化，若出现异常舌象应及时就医。\"\n}', '2025-12-23 22:33:59', 5, '正常舌象', '继续好好保养', 1, '2025-12-31 08:48:57', NULL);
INSERT INTO `tongue_diagnosis` VALUES (19, 8, '/uploads/tongue/d21f7c61-fbcc-4314-be78-51d671a6d752.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌色淡红鲜明，舌体大小适中，边缘无齿痕，舌面湿润有光泽，苔薄白且能透见舌质。根据中医舌诊理论，此为正常的舌象表现，提示脏腑功能正常，气血调和，营卫协调，未见明显病理变化。', '1. 饮食建议：保持均衡饮食，多食用山药、大枣、薏米等健脾益气的食物，避免过食生冷寒凉之品。2. 中药方剂：可选用四君子汤或八珍汤进行日常调理，以维持气血平衡。3. 生活方式：保持规律作息，避免熬夜，适度运动促进气血运行，同时保持心情舒畅，避免过度思虑和情绪波动。', '{\n \"tongueColor\": \"淡红\",\n \"tongueShape\": \"正常\",\n \"coatingColor\": \"薄白\",\n \"coatingTexture\": \"润\",\n \"specialFeatures\": \"无\",\n \"syndrome\": \"正常舌象\",\n \"analysis\": \"该舌象表现为舌色淡红鲜明，舌体大小适中，边缘无齿痕，舌面湿润有光泽，苔薄白且能透见舌质。根据中医舌诊理论，此为正常的舌象表现，提示脏腑功能正常，气血调和，营卫协调，未见明显病理变化。\",\n \"suggestions\": \"1. 饮食建议：保持均衡饮食，多食用山药、大枣、薏米等健脾益气的食物，避免过食生冷寒凉之品。2. 中药方剂：可选用四君子汤或八珍汤进行日常调理，以维持气血平衡。3. 生活方式：保持规律作息，避免熬夜，适度运动促进气血运行，同时保持心情舒畅，避免过度思虑和情绪波动。\"\n}', '2025-12-23 22:34:12', 6, '脾虚湿盛', '多运动', 1, '2026-01-02 19:41:16', NULL);
INSERT INTO `tongue_diagnosis` VALUES (20, 8, '/uploads/tongue/aa7b954c-c701-4ef4-be65-b5a1234ca61c.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌色淡红鲜明，舌体大小适中，舌面湿润有光泽，符合中医正常舌象的特征。舌质淡红表明气血调和，脏腑功能正常，营卫协调；舌苔薄白且润泽，说明体内津液未伤，无明显寒热或湿浊之邪。整体来看，此舌象反映患者目前身体健康状况良好，无明显病态。', '1. 饮食建议：保持均衡饮食，多吃新鲜蔬菜水果，适量摄入优质蛋白质如鱼肉、鸡肉等。推荐食用山药、薏米、红枣等健脾益气的食物，避免过食辛辣、油腻及生冷食物。2. 中药方剂：可选用四君子汤或八珍汤作为日常调理方剂，以补益气血、调和脾胃。3. 生活方式：保持规律作息，早睡早起，避免熬夜；适度运动如散步、太极拳等，促进气血运行；保持心情舒畅，避免情绪波动过大；注意保暖，防止外感风寒。', '{\n \"tongueColor\": \"淡红\",\n \"tongueShape\": \"正常\",\n \"coatingColor\": \"薄白\",\n \"coatingTexture\": \"润\",\n \"specialFeatures\": \"无\",\n \"syndrome\": \"正常舌象\",\n \"analysis\": \"该舌象表现为舌色淡红鲜明，舌体大小适中，舌面湿润有光泽，符合中医正常舌象的特征。舌质淡红表明气血调和，脏腑功能正常，营卫协调；舌苔薄白且润泽，说明体内津液未伤，无明显寒热或湿浊之邪。整体来看，此舌象反映患者目前身体健康状况良好，无明显病态。\",\n \"suggestions\": \"1. 饮食建议：保持均衡饮食，多吃新鲜蔬菜水果，适量摄入优质蛋白质如鱼肉、鸡肉等。推荐食用山药、薏米、红枣等健脾益气的食物，避免过食辛辣、油腻及生冷食物。2. 中药方剂：可选用四君子汤或八珍汤作为日常调理方剂，以补益气血、调和脾胃。3. 生活方式：保持规律作息，早睡早起，避免熬夜；适度运动如散步、太极拳等，促进气血运行；保持心情舒畅，避免情绪波动过大；注意保暖，防止外感风寒。\"\n}', '2025-12-23 22:34:22', 6, '无', '无', 1, '2026-01-03 00:06:02', NULL);
INSERT INTO `tongue_diagnosis` VALUES (21, 8, '/uploads/tongue/0a5dd848-a89b-42c2-835f-8d0895b3ad9f.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '该舌象表现为舌体胖大，边缘有明显的齿痕，提示脾虚导致水湿内停。舌苔白厚且呈腻状，进一步证实了湿浊内蕴的病机。淡红色的舌质表明正气尚存，但因脾虚运化失职，湿邪积聚，故出现上述表现。此为典型的脾虚湿盛证，常见于长期饮食不节、劳倦过度或久居湿地的人群。', '调理建议：1. 饮食方面，推荐食用健脾化湿的食物，如薏米、红豆、茯苓、陈皮等，可煮粥或煲汤饮用。避免肥甘厚味、甜腻、生冷及油腻食物，以免加重湿邪。2. 中药方剂可选用参苓白术散或香砂六君子汤加减，以健脾益气、化湿和中。3. 生活方式上，保持规律作息，避免熬夜，适度运动（如散步、太极拳）以促进气血运行。注意保暖，避免受寒湿侵袭，同时保持心情舒畅，避免思虑过度损伤脾胃。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"该舌象表现为舌体胖大，边缘有明显的齿痕，提示脾虚导致水湿内停。舌苔白厚且呈腻状，进一步证实了湿浊内蕴的病机。淡红色的舌质表明正气尚存，但因脾虚运化失职，湿邪积聚，故出现上述表现。此为典型的脾虚湿盛证，常见于长期饮食不节、劳倦过度或久居湿地的人群。\",\n  \"suggestions\": \"调理建议：1. 饮食方面，推荐食用健脾化湿的食物，如薏米、红豆、茯苓、陈皮等，可煮粥或煲汤饮用。避免肥甘厚味、甜腻、生冷及油腻食物，以免加重湿邪。2. 中药方剂可选用参苓白术散或香砂六君子汤加减，以健脾益气、化湿和中。3. 生活方式上，保持规律作息，避免熬夜，适度运动（如散步、太极拳）以促进气血运行。注意保暖，避免受寒湿侵袭，同时保持心情舒畅，避免思虑过度损伤脾胃。\"\n}', '2025-12-23 22:34:34', 6, '无', '无', 1, '2026-01-02 23:08:12', NULL);
INSERT INTO `tongue_diagnosis` VALUES (22, 8, '/uploads/tongue/13a495ae-5818-4096-9daf-ff1e66e2d12d.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌色淡红鲜明，舌体大小适中，边缘无齿痕，舌面湿润有光泽，苔薄白且能透见舌质。根据中医舌诊理论，此舌象符合正常舌象的特征，提示脏腑功能正常，气血调和，营卫协调。未见明显异常舌质或舌苔变化，表明患者目前处于健康状态，无明显病理表现。', '饮食建议：保持均衡饮食，多食用新鲜蔬菜水果，如芹菜、菠菜、苹果等，有助于维持身体阴阳平衡。中药方剂：无需特殊用药，可适当服用四君子汤以巩固体质，增强免疫力。生活方式：保持规律作息，避免熬夜，每日保证7-8小时睡眠；适度运动，如散步、太极拳等，促进气血运行；保持心情舒畅，避免情绪波动过大；注意保暖，防止外感风寒。', '{\n \"tongueColor\": \"淡红\",\n \"tongueShape\": \"正常\",\n \"coatingColor\": \"薄白\",\n \"coatingTexture\": \"润\",\n \"specialFeatures\": \"无\",\n \"syndrome\": \"正常舌象\",\n \"analysis\": \"该舌象表现为舌色淡红鲜明，舌体大小适中，边缘无齿痕，舌面湿润有光泽，苔薄白且能透见舌质。根据中医舌诊理论，此舌象符合正常舌象的特征，提示脏腑功能正常，气血调和，营卫协调。未见明显异常舌质或舌苔变化，表明患者目前处于健康状态，无明显病理表现。\",\n \"suggestions\": \"饮食建议：保持均衡饮食，多食用新鲜蔬菜水果，如芹菜、菠菜、苹果等，有助于维持身体阴阳平衡。中药方剂：无需特殊用药，可适当服用四君子汤以巩固体质，增强免疫力。生活方式：保持规律作息，避免熬夜，每日保证7-8小时睡眠；适度运动，如散步、太极拳等，促进气血运行；保持心情舒畅，避免情绪波动过大；注意保暖，防止外感风寒。\"\n}', '2025-12-23 22:34:42', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (23, 8, '/uploads/tongue/77764fe4-1bde-4f44-8b50-81f217e913ff.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌色淡红鲜明，舌体大小适中，形态正常，舌面湿润，薄白苔均匀分布。根据中医舌诊理论，此为典型的正常舌象，反映脏腑功能正常，气血调和，营卫协调。舌质淡红表明气血充足，未见明显寒热偏盛；薄白苔提示病邪未深入，津液未伤；舌面湿润则说明体内津液充足，无明显燥象。整体来看，此舌象是健康状态的体现，无需特殊干预。', '1. 饮食建议：维持均衡饮食，多食用山药、大枣、薏米等健脾益气的食物，避免过食辛辣、油腻及生冷食物。2. 中药方剂：可定期服用四君子汤或参苓白术散以巩固脾胃功能，保持气血充盈。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行。4. 情志调节：保持心情舒畅，避免过度思虑和情绪波动，可通过冥想或听音乐放松身心。5. 定期观察：每月检查一次舌象，若出现异常变化（如舌色变深、苔色转黄等），应及时就医复查。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"该舌象表现为舌色淡红鲜明，舌体大小适中，形态正常，舌面湿润，薄白苔均匀分布。根据中医舌诊理论，此为典型的正常舌象，反映脏腑功能正常，气血调和，营卫协调。舌质淡红表明气血充足，未见明显寒热偏盛；薄白苔提示病邪未深入，津液未伤；舌面湿润则说明体内津液充足，无明显燥象。整体来看，此舌象是健康状态的体现，无需特殊干预。\",\n  \"suggestions\": \"1. 饮食建议：维持均衡饮食，多食用山药、大枣、薏米等健脾益气的食物，避免过食辛辣、油腻及生冷食物。2. 中药方剂：可定期服用四君子汤或参苓白术散以巩固脾胃功能，保持气血充盈。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行。4. 情志调节：保持心情舒畅，避免过度思虑和情绪波动，可通过冥想或听音乐放松身心。5. 定期观察：每月检查一次舌象，若出现异常变化（如舌色变深、苔色转黄等），应及时就医复查。\"\n}', '2025-12-23 22:34:50', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (24, 8, '/uploads/tongue/acc9ec1f-4f61-4d95-80c5-7c660ee65e91.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌色淡红鲜明，舌体大小适中，形态灵活自如，舌面湿润有光泽，舌苔薄白均匀。根据中医舌诊理论，此舌象符合正常舌象的特征，提示脏腑功能正常，气血调和，营卫协调。未见明显异常征象，表明机体处于健康状态，无明显病理改变。', '1. 饮食建议：保持均衡饮食，多食用新鲜蔬菜水果，适量摄入优质蛋白质如鱼肉、鸡蛋等。推荐山药、大枣、薏米等健脾益气的食物，避免过食辛辣、油腻及生冷食物。2. 中药方剂：无需特殊用药，可定期服用四君子汤或八珍汤以巩固体质，增强脾胃功能。3. 生活方式：保持规律作息，早睡早起，避免熬夜。适度进行有氧运动如散步、太极拳，促进气血运行。保持心情舒畅，避免过度思虑和情绪波动。注意保暖，避免受凉感冒。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"该舌象表现为舌色淡红鲜明，舌体大小适中，形态灵活自如，舌面湿润有光泽，舌苔薄白均匀。根据中医舌诊理论，此舌象符合正常舌象的特征，提示脏腑功能正常，气血调和，营卫协调。未见明显异常征象，表明机体处于健康状态，无明显病理改变。\",\n  \"suggestions\": \"1. 饮食建议：保持均衡饮食，多食用新鲜蔬菜水果，适量摄入优质蛋白质如鱼肉、鸡蛋等。推荐山药、大枣、薏米等健脾益气的食物，避免过食辛辣、油腻及生冷食物。2. 中药方剂：无需特殊用药，可定期服用四君子汤或八珍汤以巩固体质，增强脾胃功能。3. 生活方式：保持规律作息，早睡早起，避免熬夜。适度进行有氧运动如散步、太极拳，促进气血运行。保持心情舒畅，避免过度思虑和情绪波动。注意保暖，避免受凉感冒。\"\n}', '2025-12-23 22:35:04', 6, '无', '无', 1, '2026-01-02 22:14:21', NULL);
INSERT INTO `tongue_diagnosis` VALUES (25, 8, '/uploads/tongue/e0292cda-04be-45d0-bf36-2c44dc752b6c.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌色淡红鲜明，舌体大小适中，舌面湿润有光泽，舌苔薄白且能透见舌质。根据中医舌诊理论，此舌象符合正常舌象的特征，提示脏腑功能正常，气血调和，营卫协调。舌质淡红表明气血充盈，未见明显寒热虚实之象；舌苔薄白且润泽，说明津液未伤，病邪尚未深入。整体来看，此舌象反映患者目前处于健康状态，无明显病理表现。', '饮食建议：保持均衡饮食，多食用新鲜蔬菜水果，如芹菜、菠菜、苹果等，以补充维生素和膳食纤维。适量摄入优质蛋白质，如鱼肉、鸡肉、豆制品，增强体质。避免过食辛辣、油腻、生冷食物，以免损伤脾胃。中药方剂：无需特殊用药，可适当饮用黄芪红枣茶或枸杞菊花茶，以滋养气血、清肝明目。若出现轻微不适，可选用四君子汤或归脾汤调理脾胃，增强免疫力。生活方式：保持规律作息，早睡早起，避免熬夜。每日进行适度运动，如散步、瑜伽，促进气血运行。保持心情舒畅，避免情绪波动过大。定期体检，关注身体健康状况。', '{\n \"tongueColor\": \"淡红\",\n \"tongueShape\": \"正常\",\n \"coatingColor\": \"薄白\",\n \"coatingTexture\": \"润\",\n \"specialFeatures\": \"无\",\n \"syndrome\": \"正常舌象\",\n \"analysis\": \"该舌象表现为舌色淡红鲜明，舌体大小适中，舌面湿润有光泽，舌苔薄白且能透见舌质。根据中医舌诊理论，此舌象符合正常舌象的特征，提示脏腑功能正常，气血调和，营卫协调。舌质淡红表明气血充盈，未见明显寒热虚实之象；舌苔薄白且润泽，说明津液未伤，病邪尚未深入。整体来看，此舌象反映患者目前处于健康状态，无明显病理表现。\",\n \"suggestions\": \"饮食建议：保持均衡饮食，多食用新鲜蔬菜水果，如芹菜、菠菜、苹果等，以补充维生素和膳食纤维。适量摄入优质蛋白质，如鱼肉、鸡肉、豆制品，增强体质。避免过食辛辣、油腻、生冷食物，以免损伤脾胃。中药方剂：无需特殊用药，可适当饮用黄芪红枣茶或枸杞菊花茶，以滋养气血、清肝明目。若出现轻微不适，可选用四君子汤或归脾汤调理脾胃，增强免疫力。生活方式：保持规律作息，早睡早起，避免熬夜。每日进行适度运动，如散步、瑜伽，促进气血运行。保持心情舒畅，避免情绪波动过大。定期体检，关注身体健康状况。\"\n}', '2025-12-23 22:35:26', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (26, 8, '/uploads/tongue/1e6ef0c0-1586-4877-9fcb-8d10f27c0854.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所困而肿胀，受牙齿挤压形成齿痕。舌苔白厚腻，为湿浊内盛之象，说明湿邪阻滞中焦，脾胃运化功能失常。根据《内经》‘诸湿肿满，皆属于脾’，此证属脾虚湿盛典型表现。脾主运化水谷精微与水液，脾虚则运化无力，水湿停滞，聚而成痰，故见舌苔厚腻。若不及时调理，易发展为痰湿阻络、气机不畅等病证。', '1. 饮食建议：宜清淡易消化，多食健脾利湿之品，如薏苡仁、赤小豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷、辛辣及肥甘厚味，以免助湿生痰。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若湿重于脾虚，可用平胃散加减。3. 生活方式：保持规律作息，避免久坐不动，适当运动如八段锦、散步，促进气血运行，增强脾的运化功能；注意腹部保暖，避免受寒湿侵袭；情绪调摄亦重要，避免思虑过度伤脾。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"舌边有明显齿痕，舌体饱满，苔色白厚且粘腻\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所困而肿胀，受牙齿挤压形成齿痕。舌苔白厚腻，为湿浊内盛之象，说明湿邪阻滞中焦，脾胃运化功能失常。根据《内经》‘诸湿肿满，皆属于脾’，此证属脾虚湿盛典型表现。脾主运化水谷精微与水液，脾虚则运化无力，水湿停滞，聚而成痰，故见舌苔厚腻。若不及时调理，易发展为痰湿阻络、气机不畅等病证。\",\n  \"suggestions\": \"1. 饮食建议：宜清淡易消化，多食健脾利湿之品，如薏苡仁、赤小豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷、辛辣及肥甘厚味，以免助湿生痰。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若湿重于脾虚，可用平胃散加减。3. 生活方式：保持规律作息，避免久坐不动，适当运动如八段锦、散步，促进气血运行，增强脾的运化功能；注意腹部保暖，避免受寒湿侵袭；情绪调摄亦重要，避免思虑过度伤脾。\"\n}', '2025-12-23 22:48:07', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (27, 8, '/uploads/tongue/f73adf62-8ab7-4d5d-b28b-5f8bb78170c2.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所困而肿胀，受牙齿挤压形成齿痕。舌苔白厚腻，为湿浊内盛之象，说明湿邪阻滞中焦，脾胃运化功能失常。根据《中医诊断学》理论，‘舌胖大有齿痕’为脾虚湿盛的典型表现，湿邪困脾则运化无力，故见舌苔厚腻。此证多因饮食不节、过食生冷或久居潮湿环境所致，属本虚标实之证。', '1. 饮食建议：宜清淡易消化，多吃健脾利湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷、辛辣及煎炸食品，避免饮酒。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若痰湿较重，可加用二陈汤化痰祛湿。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，促进气血运行，助脾运化；注意保暖避湿，居住环境应干燥通风。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"舌边有明显齿痕，舌体饱满，苔色白厚且黏腻\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所困而肿胀，受牙齿挤压形成齿痕。舌苔白厚腻，为湿浊内盛之象，说明湿邪阻滞中焦，脾胃运化功能失常。根据《中医诊断学》理论，‘舌胖大有齿痕’为脾虚湿盛的典型表现，湿邪困脾则运化无力，故见舌苔厚腻。此证多因饮食不节、过食生冷或久居潮湿环境所致，属本虚标实之证。\",\n  \"suggestions\": \"1. 饮食建议：宜清淡易消化，多吃健脾利湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷、辛辣及煎炸食品，避免饮酒。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若痰湿较重，可加用二陈汤化痰祛湿。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，促进气血运行，助脾运化；注意保暖避湿，居住环境应干燥通风。\"\n}', '2025-12-23 22:48:37', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (28, 8, '/uploads/tongue/60f15205-a7d1-4095-a0a9-4fd038cf4dbc.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '此舌象舌质淡红鲜明，色泽均匀，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合《中医诊断学》中‘淡红舌、薄白苔’的正常标准。说明气血调和，脏腑功能正常，营卫运行通畅，无明显寒热虚实偏颇。舌色不淡不红，无瘀斑点刺，舌苔不厚不腻，亦无剥落，提示无湿浊、痰饮、阴虚等病理因素存在。整体反映机体阴阳平衡，正气充足。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜、菠菜等，避免过食辛辣、油腻、煎炸之品，以免助热生湿；可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤（党参、白术、茯苓、甘草）调理脾胃，但非必需。3. 生活方式：维持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情绪波动过大；注意防寒保暖，尤其在季节交替时。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"此舌象舌质淡红鲜明，色泽均匀，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合《中医诊断学》中‘淡红舌、薄白苔’的正常标准。说明气血调和，脏腑功能正常，营卫运行通畅，无明显寒热虚实偏颇。舌色不淡不红，无瘀斑点刺，舌苔不厚不腻，亦无剥落，提示无湿浊、痰饮、阴虚等病理因素存在。整体反映机体阴阳平衡，正气充足。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜、菠菜等，避免过食辛辣、油腻、煎炸之品，以免助热生湿；可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤（党参、白术、茯苓、甘草）调理脾胃，但非必需。3. 生活方式：维持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情绪波动过大；注意防寒保暖，尤其在季节交替时。\"\n}', '2025-12-23 22:49:06', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (29, 8, '/uploads/tongue/5fe824dd-9bd1-40f1-ad7a-1a4d39ef9b09.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红鲜明，滋润适中，舌体大小正常，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。此为典型的正常舌象，反映气血调和、脏腑功能正常、营卫通畅。《伤寒论》云：‘舌上白胎者，为在表’，此处薄白苔属生理状态，非病邪所主。整体观之，无明显病理特征，提示机体阴阳平衡，脾胃运化正常。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼、蛋、豆制品。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤调理脾胃，但非必要。3. 生活方式：维持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，防止外感六淫之邪。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红鲜明，滋润适中，舌体大小正常，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。此为典型的正常舌象，反映气血调和、脏腑功能正常、营卫通畅。《伤寒论》云：‘舌上白胎者，为在表’，此处薄白苔属生理状态，非病邪所主。整体观之，无明显病理特征，提示机体阴阳平衡，脾胃运化正常。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼、蛋、豆制品。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤调理脾胃，但非必要。3. 生活方式：维持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，防止外感六淫之邪。\"\n}', '2025-12-23 22:49:24', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (30, 1, '/uploads/tongue/b2a62885-3a34-457c-804a-4d2656fde948.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红鲜明，滋润适中，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。此为气血调和、脏腑功能正常之象，符合《中医诊断学》中‘淡红舌、薄白苔’的正常标准。舌色反映气血盛衰，淡红说明气血充盈；舌苔主邪气深浅，薄白苔提示外邪未入里，正气未伤。整体舌象无病理性改变，属健康状态。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物。可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤（党参、白术、茯苓、甘草）调理脾胃。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，预防外感。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红鲜明，滋润适中，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。此为气血调和、脏腑功能正常之象，符合《中医诊断学》中‘淡红舌、薄白苔’的正常标准。舌色反映气血盛衰，淡红说明气血充盈；舌苔主邪气深浅，薄白苔提示外邪未入里，正气未伤。整体舌象无病理性改变，属健康状态。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物。可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤（党参、白术、茯苓、甘草）调理脾胃。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，预防外感。\"\n}', '2025-12-26 10:22:17', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (31, 1, '/uploads/tongue/95df069c-5090-4792-8324-aa73b96936d9.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '此舌象舌质淡红鲜明，滋润适中，舌体大小正常，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。根据《中医诊断学》标准，此为典型的正常舌象，提示气血调和、脏腑功能正常、营卫通畅。舌色淡红反映气血充盈而不过盛，苔薄白润说明胃气充足、津液未伤，无病邪侵袭之象。整体符合‘淡红舌、薄白苔’的健康标准，属生理常态。', '1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、红枣、莲子、小米粥等以健脾养胃；避免过食辛辣燥热、生冷油腻食物，以免损伤脾胃。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用四君子汤（党参、白术、茯苓、甘草）调理脾胃。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情志过激。注意观察舌象变化，如有异常及时就医。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"此舌象舌质淡红鲜明，滋润适中，舌体大小正常，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。根据《中医诊断学》标准，此为典型的正常舌象，提示气血调和、脏腑功能正常、营卫通畅。舌色淡红反映气血充盈而不过盛，苔薄白润说明胃气充足、津液未伤，无病邪侵袭之象。整体符合‘淡红舌、薄白苔’的健康标准，属生理常态。\",\n  \"suggestions\": \"1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、红枣、莲子、小米粥等以健脾养胃；避免过食辛辣燥热、生冷油腻食物，以免损伤脾胃。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用四君子汤（党参、白术、茯苓、甘草）调理脾胃。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情志过激。注意观察舌象变化，如有异常及时就医。\"\n}', '2025-12-29 10:38:27', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (32, 1, '/uploads/tongue/15327456-9214-4cab-ac8f-d9b18d41e213.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '此舌象舌质淡红鲜明，苔色薄白，苔质润泽，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据《中医诊断学》理论，淡红舌为气血调和之象，薄白苔为胃气正常之征，说明脏腑功能协调，营卫调和，无明显寒热虚实偏颇。舌体灵活自如，无歪斜、强硬等病理变化，提示无痰浊阻络或热入心包之象。综合判断为正常舌象。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，适量摄入优质蛋白，避免过食辛辣、油腻、生冷食物，以免损伤脾胃。2. 中药方剂：无需用药，维持健康状态即可；若偶有不适可酌情选用四君子汤调理脾胃。3. 生活方式：保持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，预防外感。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"此舌象舌质淡红鲜明，苔色薄白，苔质润泽，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据《中医诊断学》理论，淡红舌为气血调和之象，薄白苔为胃气正常之征，说明脏腑功能协调，营卫调和，无明显寒热虚实偏颇。舌体灵活自如，无歪斜、强硬等病理变化，提示无痰浊阻络或热入心包之象。综合判断为正常舌象。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，适量摄入优质蛋白，避免过食辛辣、油腻、生冷食物，以免损伤脾胃。2. 中药方剂：无需用药，维持健康状态即可；若偶有不适可酌情选用四君子汤调理脾胃。3. 生活方式：保持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，预防外感。\"\n}', '2025-12-29 10:49:44', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (33, 1, '/uploads/tongue/b6b363c9-165b-41b6-a766-67946eb5bf9e.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、邪未入里之征，舌面湿润说明津液充足。整体符合《伤寒论》所言‘舌上无苔，舌色淡红’之正常状态，提示脏腑功能协调，营卫调和，无明显病邪侵袭。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食五谷杂粮、新鲜蔬菜水果，如山药、莲子、红枣、苹果等，避免过食辛辣、油腻、生冷食物。2. 中药方剂：无需用药，可适当饮用黄芪枸杞茶以扶助正气。3. 生活方式：维持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情志过激。若出现其他不适症状，应及时就医辨证施治。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"该舌象舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、邪未入里之征，舌面湿润说明津液充足。整体符合《伤寒论》所言‘舌上无苔，舌色淡红’之正常状态，提示脏腑功能协调，营卫调和，无明显病邪侵袭。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食五谷杂粮、新鲜蔬菜水果，如山药、莲子、红枣、苹果等，避免过食辛辣、油腻、生冷食物。2. 中药方剂：无需用药，可适当饮用黄芪枸杞茶以扶助正气。3. 生活方式：维持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情志过激。若出现其他不适症状，应及时就医辨证施治。\"\n}', '2025-12-29 10:58:56', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (34, 1, '/uploads/tongue/9377922c-b951-4ee9-ad84-335bfc60c332.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象舌质淡红鲜明，色泽均匀，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合中医所言‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，提示营卫调和、脾胃运化正常，无明显寒热虚实偏颇。根据《伤寒论》及《中医诊断学》理论，此类舌象为健康状态之典型表现。', '1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、莲子、小米粥等健脾养胃之品，避免过食辛辣、油腻、生冷食物。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用四君子汤（党参、白术、茯苓、甘草）以增强体质。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，有助于气血运行；保持心情舒畅，避免情志过激，有利于肝气疏泄与脾胃运化。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"该舌象舌质淡红鲜明，色泽均匀，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合中医所言‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，提示营卫调和、脾胃运化正常，无明显寒热虚实偏颇。根据《伤寒论》及《中医诊断学》理论，此类舌象为健康状态之典型表现。\",\n  \"suggestions\": \"1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、莲子、小米粥等健脾养胃之品，避免过食辛辣、油腻、生冷食物。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用四君子汤（党参、白术、茯苓、甘草）以增强体质。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，有助于气血运行；保持心情舒畅，避免情志过激，有利于肝气疏泄与脾胃运化。\"\n}', '2025-12-29 10:59:12', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (35, 1, '/uploads/tongue/7608282c-31db-441d-8694-25598f54455b.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红鲜明，苔色薄白，苔质润泽，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常之征，润苔提示津液未伤。整体舌象符合《内经》所言‘舌者，心之苗，脾之外候’的健康状态，反映脏腑功能协调，营卫调和，无明显病邪侵袭。此为典型正常舌象。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白如瘦肉、鱼类，配合五谷杂粮以健脾养胃。2. 中药方剂：无需用药，可适当饮用山药粥、红枣莲子汤以增强脾胃功能，维持正气。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情志过激，有助于维持阴阳平衡与脏腑协调。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红鲜明，苔色薄白，苔质润泽，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常之征，润苔提示津液未伤。整体舌象符合《内经》所言‘舌者，心之苗，脾之外候’的健康状态，反映脏腑功能协调，营卫调和，无明显病邪侵袭。此为典型正常舌象。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白如瘦肉、鱼类，配合五谷杂粮以健脾养胃。2. 中药方剂：无需用药，可适当饮用山药粥、红枣莲子汤以增强脾胃功能，维持正气。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情志过激，有助于维持阴阳平衡与脏腑协调。\"\n}', '2025-12-29 11:06:05', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (36, 1, '/uploads/tongue/95829f7f-d41d-474f-b32a-357aa68410c5.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '本舌象舌质淡红鲜明，苔色薄白，苔质润泽，舌体大小适中，无齿痕、裂纹、点刺等异常形态。根据《中医诊断学》标准，此为典型正常舌象，反映气血调和、脏腑功能正常、营卫运行有序。舌色淡红说明气血充盈而不过盛，苔薄白润提示胃气正常、津液未伤，无病邪侵袭之象。整体符合‘淡红舌、薄白苔’的健康标准，属生理常态。', '1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、莲子、小米、苹果等，避免过食辛辣燥热或生冷寒凉食物；2. 中药方剂：无需用药，可适当饮用枸杞菊花茶以清肝明目、调和阴阳；3. 生活方式：保持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情志过激。若出现不适症状，应及时就医辨证施治。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"本舌象舌质淡红鲜明，苔色薄白，苔质润泽，舌体大小适中，无齿痕、裂纹、点刺等异常形态。根据《中医诊断学》标准，此为典型正常舌象，反映气血调和、脏腑功能正常、营卫运行有序。舌色淡红说明气血充盈而不过盛，苔薄白润提示胃气正常、津液未伤，无病邪侵袭之象。整体符合‘淡红舌、薄白苔’的健康标准，属生理常态。\",\n  \"suggestions\": \"1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、莲子、小米、苹果等，避免过食辛辣燥热或生冷寒凉食物；2. 中药方剂：无需用药，可适当饮用枸杞菊花茶以清肝明目、调和阴阳；3. 生活方式：保持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情志过激。若出现不适症状，应及时就医辨证施治。\"\n}', '2025-12-29 11:06:31', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (37, 1, '/uploads/tongue/682c1426-9114-4ae1-8014-579014b2f356.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红鲜明，滋润适中，舌体大小正常，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行有序。根据《中医诊断学》理论，淡红舌为气血充盈之征，薄白苔为胃气上蒸之象，二者合参，说明机体阴阳平衡，正气充足，无明显病邪侵袭。', '饮食建议：维持均衡饮食，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻及生冷食物。中药方剂：无需用药，保持健康状态即可。生活方式：规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情志过激。可适当饮用菊花茶、枸杞水等养生饮品，增强体质。若出现不适症状，应及时就医辨证施治。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红鲜明，滋润适中，舌体大小正常，未见胖大或瘦薄，边缘无齿痕，舌苔薄白均匀，能透见舌质，苔面湿润有津。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行有序。根据《中医诊断学》理论，淡红舌为气血充盈之征，薄白苔为胃气上蒸之象，二者合参，说明机体阴阳平衡，正气充足，无明显病邪侵袭。\",\n  \"suggestions\": \"饮食建议：维持均衡饮食，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻及生冷食物。中药方剂：无需用药，保持健康状态即可。生活方式：规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，避免情志过激。可适当饮用菊花茶、枸杞水等养生饮品，增强体质。若出现不适症状，应及时就医辨证施治。\"\n}', '2025-12-29 11:06:45', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (38, 1, '/uploads/tongue/9b0ee088-4f36-484f-9c70-fca99a3bd65e.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红鲜明，苔色薄白，舌体大小适中，无齿痕、裂纹或点刺等异常表现，舌苔润泽能透见舌质，符合《中医诊断学》中‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常之征，营卫运行有序，津液充盈，无明显病邪侵袭。根据《内经》‘舌者，心之苗，脾之外候’之说，舌象反映脾胃运化与心神状态，当前舌象提示机体阴阳平衡，正气充足。', '1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、大枣、莲子、小米粥等健脾养胃之品；避免过食辛辣、油腻、生冷食物，以免损伤脾胃。2. 中药方剂：无需用药，可适当饮用菊花枸杞茶以清肝明目、调和阴阳。3. 生活方式：保持规律作息，避免熬夜，适度运动如八段锦、太极拳以促进气血运行；保持心情舒畅，避免情志过激。若出现不适症状，应及时就医辨证施治。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红鲜明，苔色薄白，舌体大小适中，无齿痕、裂纹或点刺等异常表现，舌苔润泽能透见舌质，符合《中医诊断学》中‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常之征，营卫运行有序，津液充盈，无明显病邪侵袭。根据《内经》‘舌者，心之苗，脾之外候’之说，舌象反映脾胃运化与心神状态，当前舌象提示机体阴阳平衡，正气充足。\",\n  \"suggestions\": \"1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、大枣、莲子、小米粥等健脾养胃之品；避免过食辛辣、油腻、生冷食物，以免损伤脾胃。2. 中药方剂：无需用药，可适当饮用菊花枸杞茶以清肝明目、调和阴阳。3. 生活方式：保持规律作息，避免熬夜，适度运动如八段锦、太极拳以促进气血运行；保持心情舒畅，避免情志过激。若出现不适症状，应及时就医辨证施治。\"\n}', '2025-12-29 11:07:05', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (39, 1, '/uploads/tongue/e2e27e51-df1c-484b-ac69-587f5bb97b0f.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红，色泽鲜明，滋润适中，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合《中医诊断学》中‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，营卫运行通畅，津液充盈，无明显病邪侵袭。根据《内经》‘舌为心之苗，脾之外候’之说，舌象反映五脏六腑之气机状态，当前舌象提示机体阴阳平衡，正气充足。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼类、豆制品，有助于维持气血调和。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用菊花茶、枸杞水以清肝明目、滋补肝肾。3. 生活方式：保持规律作息，避免熬夜，保证充足睡眠；适度运动，如散步、太极拳，促进气血运行；保持心情舒畅，避免情志过激，有利于脏腑功能协调。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红，色泽鲜明，滋润适中，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合《中医诊断学》中‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，营卫运行通畅，津液充盈，无明显病邪侵袭。根据《内经》‘舌为心之苗，脾之外候’之说，舌象反映五脏六腑之气机状态，当前舌象提示机体阴阳平衡，正气充足。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼类、豆制品，有助于维持气血调和。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用菊花茶、枸杞水以清肝明目、滋补肝肾。3. 生活方式：保持规律作息，避免熬夜，保证充足睡眠；适度运动，如散步、太极拳，促进气血运行；保持心情舒畅，避免情志过激，有利于脏腑功能协调。\"\n}', '2025-12-29 11:09:56', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (40, 1, '/uploads/tongue/73a41505-181c-4452-8dac-bf47edc666e7.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '该舌象表现为舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、津液未伤的表现，整体符合健康状态的舌象特征。舌体灵活自如，无肿胀或瘦薄，提示脏腑功能协调，营卫调和，无明显寒热虚实偏颇。此舌象常见于体质平和、饮食规律、作息正常之人。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜、菠菜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼类、豆制品、瘦肉。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用菊花茶、枸杞水以清肝明目、滋补肝肾。3. 生活方式：维持规律作息，避免熬夜，保证充足睡眠；适度运动，如散步、太极拳，促进气血运行；保持情绪舒畅，避免长期焦虑或压力过大。定期观察舌象变化，如有异常及时就医。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"该舌象表现为舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、津液未伤的表现，整体符合健康状态的舌象特征。舌体灵活自如，无肿胀或瘦薄，提示脏腑功能协调，营卫调和，无明显寒热虚实偏颇。此舌象常见于体质平和、饮食规律、作息正常之人。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜、菠菜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼类、豆制品、瘦肉。2. 中药方剂：无需用药，若偶有轻微不适可适当饮用菊花茶、枸杞水以清肝明目、滋补肝肾。3. 生活方式：维持规律作息，避免熬夜，保证充足睡眠；适度运动，如散步、太极拳，促进气血运行；保持情绪舒畅，避免长期焦虑或压力过大。定期观察舌象变化，如有异常及时就医。\"\n}', '2025-12-29 11:15:19', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (41, 1, '/uploads/tongue/be7faa32-29a7-4e3d-a68f-e4c680bedd3a.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '舌体胖大且边缘有清晰齿痕，为脾虚不能运化水湿，导致水湿内停，舌体被湿气濡润而肿胀，受牙齿压迫形成齿痕。舌苔白厚腻，说明湿浊之邪蕴结于中焦，脾胃运化功能失常，湿浊不化。此为典型的脾虚湿盛证候，符合《内经》所言‘诸湿肿满，皆属于脾’的病机理论。脾主运化水谷精微与水液，脾虚则运化无力，水湿停滞，聚而成痰成饮，故见舌胖齿痕、苔腻。', '1. 饮食建议：宜食健脾利湿之品，如薏苡仁、赤小豆、山药、茯苓、扁豆、冬瓜、陈皮等；避免生冷、油腻、甜腻食物，忌饮酒及辛辣刺激之物。2. 中药方剂：可选用参苓白术散或香砂六君子汤加减，以健脾益气、渗湿止泻；若湿重者可合用平胃散以燥湿行气。3. 生活方式：保持规律作息，避免久坐不动，适当运动如散步、八段锦等以助脾运；注意腹部保暖，防止寒湿侵袭；情绪宜舒畅，避免思虑过度伤脾。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"舌边有明显齿痕，舌体饱满充盈口腔\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"舌体胖大且边缘有清晰齿痕，为脾虚不能运化水湿，导致水湿内停，舌体被湿气濡润而肿胀，受牙齿压迫形成齿痕。舌苔白厚腻，说明湿浊之邪蕴结于中焦，脾胃运化功能失常，湿浊不化。此为典型的脾虚湿盛证候，符合《内经》所言‘诸湿肿满，皆属于脾’的病机理论。脾主运化水谷精微与水液，脾虚则运化无力，水湿停滞，聚而成痰成饮，故见舌胖齿痕、苔腻。\",\n  \"suggestions\": \"1. 饮食建议：宜食健脾利湿之品，如薏苡仁、赤小豆、山药、茯苓、扁豆、冬瓜、陈皮等；避免生冷、油腻、甜腻食物，忌饮酒及辛辣刺激之物。2. 中药方剂：可选用参苓白术散或香砂六君子汤加减，以健脾益气、渗湿止泻；若湿重者可合用平胃散以燥湿行气。3. 生活方式：保持规律作息，避免久坐不动，适当运动如散步、八段锦等以助脾运；注意腹部保暖，防止寒湿侵袭；情绪宜舒畅，避免思虑过度伤脾。\"\n}', '2025-12-29 11:26:41', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (42, 1, '/uploads/tongue/e55b5afa-7e0f-46ee-8259-2bfd8f0a0654.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '此舌象表现为舌体胖大，边缘有清晰齿痕，舌苔白厚腻，为典型的脾虚湿盛之象。《素问·至真要大论》云：‘诸湿肿满，皆属于脾。’脾主运化水湿，若脾气虚弱，则运化失职，水湿内停，聚而为痰饮，故见舌体胖大、齿痕；湿浊上泛于舌面，则形成白厚腻苔。舌色淡红提示气血未至亏虚，但湿邪困阻中焦，影响气机升降，故可见神疲乏力、腹胀便溏等症。此证属本虚标实，以脾虚为本，湿盛为标。', '1. 饮食建议：宜清淡易消化，多食健脾利湿之品，如薏苡仁、赤小豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷及辛辣刺激食物，避免加重湿浊。2. 中药方剂：可选用参苓白术散或香砂六君子汤加减，以健脾益气、化湿和中；若兼有痰湿壅盛者，可合用二陈汤。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，以助脾运化；注意腹部保暖，防止寒湿侵袭；情绪调畅，避免思虑过度伤脾。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"舌边有明显齿痕，舌体饱满充盈口腔\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"此舌象表现为舌体胖大，边缘有清晰齿痕，舌苔白厚腻，为典型的脾虚湿盛之象。《素问·至真要大论》云：‘诸湿肿满，皆属于脾。’脾主运化水湿，若脾气虚弱，则运化失职，水湿内停，聚而为痰饮，故见舌体胖大、齿痕；湿浊上泛于舌面，则形成白厚腻苔。舌色淡红提示气血未至亏虚，但湿邪困阻中焦，影响气机升降，故可见神疲乏力、腹胀便溏等症。此证属本虚标实，以脾虚为本，湿盛为标。\",\n  \"suggestions\": \"1. 饮食建议：宜清淡易消化，多食健脾利湿之品，如薏苡仁、赤小豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷及辛辣刺激食物，避免加重湿浊。2. 中药方剂：可选用参苓白术散或香砂六君子汤加减，以健脾益气、化湿和中；若兼有痰湿壅盛者，可合用二陈汤。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，以助脾运化；注意腹部保暖，防止寒湿侵袭；情绪调畅，避免思虑过度伤脾。\"\n}', '2025-12-29 13:22:56', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (43, 1, '/uploads/tongue/e41c0cd0-a5fb-4396-b0f5-5a8e1383d913.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红，苔色薄白而润，舌体大小适中，无齿痕、裂纹或点刺等异常表现。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行有序。《伤寒论》云：‘舌上白胎者，为里证’，但此处苔薄白而能透见舌质，属表邪未入里之象；舌色不偏淡不偏红，说明无明显虚实寒热偏颇。整体反映机体阴阳平衡，正气充足，无病邪内扰。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物，以免助热生湿。可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤（党参、白术、茯苓、甘草）调理脾胃，增强体质。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，促进气血流通。注意情绪调节，避免过度思虑伤脾。定期观察舌象变化，如有异常及时就医。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红，苔色薄白而润，舌体大小适中，无齿痕、裂纹或点刺等异常表现。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行有序。《伤寒论》云：‘舌上白胎者，为里证’，但此处苔薄白而能透见舌质，属表邪未入里之象；舌色不偏淡不偏红，说明无明显虚实寒热偏颇。整体反映机体阴阳平衡，正气充足，无病邪内扰。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物，以免助热生湿。可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情使用四君子汤（党参、白术、茯苓、甘草）调理脾胃，增强体质。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，促进气血流通。注意情绪调节，避免过度思虑伤脾。定期观察舌象变化，如有异常及时就医。\"\n}', '2025-12-29 15:39:00', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (44, 1, '/uploads/tongue/ef121893-d660-414d-994c-29f40fe56236.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '此舌象表现为舌体胖大，边缘有明显齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所浸而肿胀，受牙齿压迫形成齿痕。舌苔白厚腻，为湿浊内盛之象，说明湿邪困阻中焦，脾胃运化功能失常。根据《中医诊断学》理论，‘舌胖大有齿痕’是脾虚湿盛的典型表现，湿邪重浊黏腻，故苔质腻而不易刮去。此证多因饮食不节、过食生冷肥甘，损伤脾阳，或久病体虚所致。', '1. 饮食建议：宜清淡易消化，多吃健脾祛湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷、辛辣及酒类，避免加重湿浊。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若兼有痰湿阻滞，可用二陈汤加减。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，促进气血运行，助脾运化；注意腹部保暖，避免受寒。若症状持续或加重，建议及时就医辨证施治。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"舌边有明显齿痕，舌体饱满，苔色均匀覆盖舌面\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"此舌象表现为舌体胖大，边缘有明显齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所浸而肿胀，受牙齿压迫形成齿痕。舌苔白厚腻，为湿浊内盛之象，说明湿邪困阻中焦，脾胃运化功能失常。根据《中医诊断学》理论，‘舌胖大有齿痕’是脾虚湿盛的典型表现，湿邪重浊黏腻，故苔质腻而不易刮去。此证多因饮食不节、过食生冷肥甘，损伤脾阳，或久病体虚所致。\",\n  \"suggestions\": \"1. 饮食建议：宜清淡易消化，多吃健脾祛湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷、辛辣及酒类，避免加重湿浊。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若兼有痰湿阻滞，可用二陈汤加减。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，促进气血运行，助脾运化；注意腹部保暖，避免受寒。若症状持续或加重，建议及时就医辨证施治。\"\n}', '2025-12-29 15:39:31', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (45, 1, '/uploads/tongue/85891728-b382-48f7-af32-dbdf609287d1.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '此舌象舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、外邪未入之征，舌面湿润说明津液充足。整体符合《伤寒论》所言‘舌淡红、苔薄白’为正气存内、营卫调和的典型表现，提示脏腑功能正常，无明显病邪侵袭。', '1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、莲子、小米粥等健脾养胃之品；避免过食辛辣、油腻、生冷食物，以免损伤脾胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情服用四君子汤或参苓白术散以增强脾胃运化功能。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免思虑过度，有助于维护脏腑平衡。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"此舌象舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、外邪未入之征，舌面湿润说明津液充足。整体符合《伤寒论》所言‘舌淡红、苔薄白’为正气存内、营卫调和的典型表现，提示脏腑功能正常，无明显病邪侵袭。\",\n  \"suggestions\": \"1. 饮食建议：维持均衡饮食，宜多食五谷杂粮、新鲜蔬果，如山药、莲子、小米粥等健脾养胃之品；避免过食辛辣、油腻、生冷食物，以免损伤脾胃。2. 中药方剂：无需用药，若偶有轻微不适可酌情服用四君子汤或参苓白术散以增强脾胃运化功能。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免思虑过度，有助于维护脏腑平衡。\"\n}', '2025-12-29 23:20:40', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (46, 1, '/uploads/tongue/68a05223-33dc-46d1-bb27-013971209428.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '此舌象舌质淡红鲜明，苔色薄白，能透见舌质，苔面湿润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据《中医诊断学》理论，淡红舌为气血调和之象，薄白苔为胃气正常之征，说明脏腑功能协调，营卫调和，无明显病邪侵袭。舌象整体符合健康状态的标准，未见虚实寒热偏颇之象。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如瘦肉、鱼类、豆制品。2. 中药方剂：无需用药，可适当饮用菊花茶、枸杞水以辅助养生。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，促进气血运行；保持心情舒畅，避免情绪波动过大。若出现其他不适症状，应及时就医。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"此舌象舌质淡红鲜明，苔色薄白，能透见舌质，苔面湿润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据《中医诊断学》理论，淡红舌为气血调和之象，薄白苔为胃气正常之征，说明脏腑功能协调，营卫调和，无明显病邪侵袭。舌象整体符合健康状态的标准，未见虚实寒热偏颇之象。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如瘦肉、鱼类、豆制品。2. 中药方剂：无需用药，可适当饮用菊花茶、枸杞水以辅助养生。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，促进气血运行；保持心情舒畅，避免情绪波动过大。若出现其他不适症状，应及时就医。\"\n}', '2025-12-31 08:24:35', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (47, 1, '/uploads/tongue/532ea91b-c9dc-4bb1-8ea6-8255115e0b5b.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿邪所困而肿胀，受牙齿压迫形成齿痕。舌苔白厚腻，说明湿浊内盛，痰湿阻滞中焦。根据《中医诊断学》理论，‘舌胖大有齿痕’为脾虚湿盛之典型表现，脾主运化，脾虚则水湿不化，聚而成痰，故见舌苔厚腻。此证多因饮食不节、过食生冷油腻所致，久之伤及脾气，形成湿盛困脾之候。', '1. 饮食建议：宜清淡易消化，多吃健脾祛湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；避免甜腻、油炸、生冷、辛辣食物，忌饮酒。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若湿重于脾虚，可用平胃散加减。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，促进气血运行，助脾运化；注意腹部保暖，防止寒湿侵袭。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"舌边有明显齿痕，舌体饱满，苔色白厚且粘腻\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿邪所困而肿胀，受牙齿压迫形成齿痕。舌苔白厚腻，说明湿浊内盛，痰湿阻滞中焦。根据《中医诊断学》理论，‘舌胖大有齿痕’为脾虚湿盛之典型表现，脾主运化，脾虚则水湿不化，聚而成痰，故见舌苔厚腻。此证多因饮食不节、过食生冷油腻所致，久之伤及脾气，形成湿盛困脾之候。\",\n  \"suggestions\": \"1. 饮食建议：宜清淡易消化，多吃健脾祛湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；避免甜腻、油炸、生冷、辛辣食物，忌饮酒。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若湿重于脾虚，可用平胃散加减。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适度运动如散步、八段锦，促进气血运行，助脾运化；注意腹部保暖，防止寒湿侵袭。\"\n}', '2025-12-31 08:36:13', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (48, 1, '/uploads/tongue/fff57544-e9d7-4ee5-8955-5513d13cc6d7.jpg', '无', '无', '无', '无', '无法诊断', '当前图片为动漫角色图像，并非舌诊照片，无法观察舌质、舌苔等中医舌诊所需特征。舌诊需基于真实舌象进行分析，此图不具备任何舌象信息，故无法进行中医辨证。请上传清晰的舌部照片以便准确判断。', '请重新拍摄一张自然光线下、清晰可见舌体全貌的舌诊照片。拍摄时应注意：1. 避免刚进食或饮用有色饮料；2. 舌头自然伸出口外，不要过度用力；3. 确保光线充足且均匀；4. 拍摄角度正对舌面，避免遮挡。上传后我将为您进行专业舌诊分析。', '{\n  \"tongueColor\": \"无\",\n  \"tongueShape\": \"无\",\n  \"coatingColor\": \"无\",\n  \"coatingTexture\": \"无\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"无法诊断\",\n  \"analysis\": \"当前图片为动漫角色图像，并非舌诊照片，无法观察舌质、舌苔等中医舌诊所需特征。舌诊需基于真实舌象进行分析，此图不具备任何舌象信息，故无法进行中医辨证。请上传清晰的舌部照片以便准确判断。\",\n  \"suggestions\": \"请重新拍摄一张自然光线下、清晰可见舌体全貌的舌诊照片。拍摄时应注意：1. 避免刚进食或饮用有色饮料；2. 舌头自然伸出口外，不要过度用力；3. 确保光线充足且均匀；4. 拍摄角度正对舌面，避免遮挡。上传后我将为您进行专业舌诊分析。\"\n}', '2026-01-02 15:11:00', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (49, 6, '/uploads/tongue/a1a678f0-ebbf-46d1-aa55-6a1f577c316b.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红，色泽鲜明，舌体大小适中，伸缩自如，舌苔薄白而润，能透见舌质，符合中医所言‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，提示营卫调和，脾胃运化功能良好，无明显寒热虚实偏盛之象。根据《中医诊断学》理论，此类舌象多见于健康人群或疾病初愈者，属生理常态。', '目前舌象显示身体健康，无需特殊调理。建议继续保持规律作息，避免熬夜，饮食宜清淡均衡，忌过食辛辣、油腻及生冷食物。可适当食用山药、大枣、小米等健脾益气之品以增强体质。若出现不适症状如乏力、纳差、口苦等，应及时观察舌象变化并结合其他症状综合判断。平时注意情绪调节，保持心情舒畅，适度运动促进气血运行。若未来舌象出现异常（如齿痕、厚腻苔、红绛舌等），应进一步辨证施治。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红，色泽鲜明，舌体大小适中，伸缩自如，舌苔薄白而润，能透见舌质，符合中医所言‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，提示营卫调和，脾胃运化功能良好，无明显寒热虚实偏盛之象。根据《中医诊断学》理论，此类舌象多见于健康人群或疾病初愈者，属生理常态。\",\n  \"suggestions\": \"目前舌象显示身体健康，无需特殊调理。建议继续保持规律作息，避免熬夜，饮食宜清淡均衡，忌过食辛辣、油腻及生冷食物。可适当食用山药、大枣、小米等健脾益气之品以增强体质。若出现不适症状如乏力、纳差、口苦等，应及时观察舌象变化并结合其他症状综合判断。平时注意情绪调节，保持心情舒畅，适度运动促进气血运行。若未来舌象出现异常（如齿痕、厚腻苔、红绛舌等），应进一步辨证施治。\"\n}', '2026-01-02 16:32:06', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (50, 1, '/uploads/tongue/d5fe75a9-0802-4c1e-9966-ff00f355ebc0.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行通畅。《伤寒论》云：‘舌上无苔者，为里虚’，而本舌象苔薄白润，能透见舌质，说明胃气充足，津液未伤，无明显病邪侵袭。整体反映机体阴阳平衡，正气充盈。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜、菠菜等，避免过食辛辣、油腻、煎炸之品，以免助热生湿。可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可选用四君子汤或参苓白术散调理脾胃，但非必要不建议长期服用。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，促进气血运行；保持心情舒畅，避免情志过激；注意保暖，防止外感六淫之邪。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行通畅。《伤寒论》云：‘舌上无苔者，为里虚’，而本舌象苔薄白润，能透见舌质，说明胃气充足，津液未伤，无明显病邪侵袭。整体反映机体阴阳平衡，正气充盈。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜、菠菜等，避免过食辛辣、油腻、煎炸之品，以免助热生湿。可适量食用山药、莲子、小米粥以健脾养胃。2. 中药方剂：无需用药，若偶有轻微不适可选用四君子汤或参苓白术散调理脾胃，但非必要不建议长期服用。3. 生活方式：保持规律作息，避免熬夜，适度运动如散步、太极拳，促进气血运行；保持心情舒畅，避免情志过激；注意保暖，防止外感六淫之邪。\"\n}', '2026-01-02 16:58:15', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (51, 1, '/uploads/tongue/e0b35f13-ba81-4761-954f-b097493f14b5.jpg', '无', '无', '无', '无', '无法判断', '当前图片为动漫角色图像，并非舌诊照片，无法进行舌象分析。舌诊需基于真实舌部影像，观察舌质、舌苔等特征以辨证论治。请上传清晰的舌象照片以便准确诊断。', '建议您重新拍摄一张自然光线下、伸舌适中的舌部照片，确保舌体完整、无食物染色或口腔污染。拍摄时避免刚进食、喝咖啡或含漱后立即拍照。若需进一步中医辨证，请提供真实舌象及全身症状描述。', '{\n  \"tongueColor\": \"无\",\n  \"tongueShape\": \"无\",\n  \"coatingColor\": \"无\",\n  \"coatingTexture\": \"无\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"无法判断\",\n  \"analysis\": \"当前图片为动漫角色图像，并非舌诊照片，无法进行舌象分析。舌诊需基于真实舌部影像，观察舌质、舌苔等特征以辨证论治。请上传清晰的舌象照片以便准确诊断。\",\n  \"suggestions\": \"建议您重新拍摄一张自然光线下、伸舌适中的舌部照片，确保舌体完整、无食物染色或口腔污染。拍摄时避免刚进食、喝咖啡或含漱后立即拍照。若需进一步中医辨证，请提供真实舌象及全身症状描述。\"\n}', '2026-01-02 19:34:20', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (52, 1, '/uploads/tongue/e332aeaf-9c5c-4726-9a73-f1d6ebf57604.jpg', '淡红', '胖大有齿痕', '白厚腻', '腻', '脾虚湿盛', '此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所困而肿胀。舌苔白厚腻为湿浊内盛之象，说明湿邪阻滞中焦，脾胃运化功能失常。根据《中医诊断学》理论，‘舌胖大有齿痕’是脾虚湿盛的典型表现，湿邪困脾则运化无力，水湿停滞于体内，形成痰湿或水肿等病理产物。此证多见于饮食不节、久居湿地或过食生冷之人。', '1. 饮食建议：宜清淡易消化，多吃健脾利湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷及辛辣刺激性食物，避免饮酒和高糖饮食。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若湿重明显，可加用平胃散以燥湿行气。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适当运动如散步、八段锦等有助于促进气血运行、增强脾胃功能；注意保暖，避免受寒湿侵袭。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"胖大有齿痕\",\n  \"coatingColor\": \"白厚腻\",\n  \"coatingTexture\": \"腻\",\n  \"specialFeatures\": \"舌边有明显齿痕，舌体饱满，苔色白厚且粘腻\",\n  \"syndrome\": \"脾虚湿盛\",\n  \"analysis\": \"此舌象表现为舌体胖大，边缘有清晰齿痕，提示脾虚不能运化水湿，导致水湿内停，舌体被湿气所困而肿胀。舌苔白厚腻为湿浊内盛之象，说明湿邪阻滞中焦，脾胃运化功能失常。根据《中医诊断学》理论，‘舌胖大有齿痕’是脾虚湿盛的典型表现，湿邪困脾则运化无力，水湿停滞于体内，形成痰湿或水肿等病理产物。此证多见于饮食不节、久居湿地或过食生冷之人。\",\n  \"suggestions\": \"1. 饮食建议：宜清淡易消化，多吃健脾利湿食物，如薏米、红豆、山药、茯苓、扁豆、冬瓜、陈皮等；忌食甜腻、油腻、生冷及辛辣刺激性食物，避免饮酒和高糖饮食。2. 中药方剂：可选用参苓白术散或香砂六君子汤以健脾益气、化湿和中；若湿重明显，可加用平胃散以燥湿行气。3. 生活方式：保持规律作息，避免熬夜与过度劳累；适当运动如散步、八段锦等有助于促进气血运行、增强脾胃功能；注意保暖，避免受寒湿侵袭。\"\n}', '2026-01-02 19:34:38', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (53, 1, '/uploads/tongue/a0e5620a-9b9f-4753-8d33-7d2545f81bf6.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '舌质淡红鲜明，苔色薄白润泽，舌体大小适中，无齿痕、裂纹、点刺等异常表现。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行通畅。根据《中医诊断学》理论，淡红舌主气血平和，薄白苔为胃气未伤之象，说明机体阴阳平衡，无明显寒热虚实偏盛。此类舌象多见于健康人群或疾病初愈者。', '1. 饮食建议：保持饮食均衡，宜清淡为主，可适量食用山药、大枣、小米粥等健脾益气之品，避免过食辛辣、油腻、生冷食物。2. 中药方剂：无需用药，若体质偏弱可适当服用四君子汤以增强脾胃功能。3. 生活方式：维持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情志过激。注意观察舌象变化，如有异常及时就医。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"舌质淡红鲜明，苔色薄白润泽，舌体大小适中，无齿痕、裂纹、点刺等异常表现。此为典型的正常舌象，提示气血调和，脏腑功能正常，营卫运行通畅。根据《中医诊断学》理论，淡红舌主气血平和，薄白苔为胃气未伤之象，说明机体阴阳平衡，无明显寒热虚实偏盛。此类舌象多见于健康人群或疾病初愈者。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，可适量食用山药、大枣、小米粥等健脾益气之品，避免过食辛辣、油腻、生冷食物。2. 中药方剂：无需用药，若体质偏弱可适当服用四君子汤以增强脾胃功能。3. 生活方式：维持规律作息，避免熬夜，适度运动如散步、太极拳以促进气血运行；保持心情舒畅，避免情志过激。注意观察舌象变化，如有异常及时就医。\"\n}', '2026-01-02 19:39:51', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (54, 1, '/uploads/tongue/a6d06405-5658-40ca-aa94-c4357b86dcbb.jpg', '无', '无', '无', '无', '非舌诊图片', '当前图片为动漫角色图像，未显示舌象特征。舌诊需观察真实舌体的舌质、舌苔、形态等信息，此图无法用于中医舌诊分析。请上传清晰的舌部照片以便进行准确辨证。', '建议您重新拍摄一张自然光线下、清晰可见舌体全貌的舌诊照片。拍摄时请保持口腔清洁，避免进食、饮水或刷牙后立即拍照，伸舌自然平放，不要过度用力。确保舌面完整暴露，以便准确判断舌色、舌形、舌苔等关键指标。', '{\n  \"tongueColor\": \"无\",\n  \"tongueShape\": \"无\",\n  \"coatingColor\": \"无\",\n  \"coatingTexture\": \"无\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"非舌诊图片\",\n  \"analysis\": \"当前图片为动漫角色图像，未显示舌象特征。舌诊需观察真实舌体的舌质、舌苔、形态等信息，此图无法用于中医舌诊分析。请上传清晰的舌部照片以便进行准确辨证。\",\n  \"suggestions\": \"建议您重新拍摄一张自然光线下、清晰可见舌体全貌的舌诊照片。拍摄时请保持口腔清洁，避免进食、饮水或刷牙后立即拍照，伸舌自然平放，不要过度用力。确保舌面完整暴露，以便准确判断舌色、舌形、舌苔等关键指标。\"\n}', '2026-01-02 22:07:46', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (55, 1, '/uploads/tongue/1af9e603-32ed-4f99-b571-aeae0c983aa6.jpg', '无', '无', '无', '无', '无法辨识', '当前图片并非舌诊图像，无法观察舌质、舌苔及舌形等关键特征。图片中为一位人物做出手势，未显示舌部信息。因此无法进行中医舌诊分析。请上传清晰的舌象照片以便准确辨证。', '建议重新拍摄一张自然光线下、舌体充分伸展、舌面清洁的舌象照片。拍摄时避免刚进食、饮用咖啡或茶水后立即拍照，以免影响舌色和苔质判断。确保舌体居中，背景简洁，光线均匀。上传后可再次进行专业舌诊分析。', '{\n  \"tongueColor\": \"无\",\n  \"tongueShape\": \"无\",\n  \"coatingColor\": \"无\",\n  \"coatingTexture\": \"无\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"无法辨识\",\n  \"analysis\": \"当前图片并非舌诊图像，无法观察舌质、舌苔及舌形等关键特征。图片中为一位人物做出手势，未显示舌部信息。因此无法进行中医舌诊分析。请上传清晰的舌象照片以便准确辨证。\",\n  \"suggestions\": \"建议重新拍摄一张自然光线下、舌体充分伸展、舌面清洁的舌象照片。拍摄时避免刚进食、饮用咖啡或茶水后立即拍照，以免影响舌色和苔质判断。确保舌体居中，背景简洁，光线均匀。上传后可再次进行专业舌诊分析。\"\n}', '2026-01-02 22:12:33', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (56, 2, '/uploads/tongue/aa89d8b1-697e-46eb-8e15-1e7a300c854e.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '本舌象舌质淡红鲜明，色泽均匀，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合中医所言‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，提示营卫调和、脾胃运化良好，无明显寒热虚实偏颇。根据《中医诊断学》理论，此类舌象多见于健康人群或疾病初愈者。', '1. 饮食建议：保持饮食均衡，宜清淡易消化，可适量食用山药、红枣、小米粥等健脾益气之品，避免过食辛辣、油腻、生冷食物；2. 中药方剂：无需用药，若体质偏弱可适当服用四君子汤以增强脾胃功能；3. 生活方式：维持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，注意季节变化调整起居饮食。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"本舌象舌质淡红鲜明，色泽均匀，舌体大小适中，未见胖大或瘦薄，边缘无齿痕，舌苔薄白而润，能透见舌质，符合中医所言‘淡红舌、薄白苔’的正常舌象标准。此为气血调和、脏腑功能正常的表现，提示营卫调和、脾胃运化良好，无明显寒热虚实偏颇。根据《中医诊断学》理论，此类舌象多见于健康人群或疾病初愈者。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡易消化，可适量食用山药、红枣、小米粥等健脾益气之品，避免过食辛辣、油腻、生冷食物；2. 中药方剂：无需用药，若体质偏弱可适当服用四君子汤以增强脾胃功能；3. 生活方式：维持规律作息，避免熬夜，适度运动以促进气血运行，保持心情舒畅，注意季节变化调整起居饮食。\"\n}', '2026-01-02 23:06:40', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `tongue_diagnosis` VALUES (57, 1, '/uploads/tongue/97c89494-e18e-4382-9c55-843b2b934bfc.jpg', '淡红', '正常', '薄白', '润', '正常舌象', '本舌象舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、病邪未入里之征，整体反映脏腑功能协调，营卫调和，无明显寒热虚实偏颇。此为健康舌象，提示机体阴阳平衡，正气充足。', '1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼类、瘦肉、豆制品。2. 中药方剂：无需用药，可适当饮用菊花茶、枸杞水以助养生。3. 生活方式：维持规律作息，避免熬夜，适度运动如散步、太极拳，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，预防外感。', '{\n  \"tongueColor\": \"淡红\",\n  \"tongueShape\": \"正常\",\n  \"coatingColor\": \"薄白\",\n  \"coatingTexture\": \"润\",\n  \"specialFeatures\": \"无\",\n  \"syndrome\": \"正常舌象\",\n  \"analysis\": \"本舌象舌质淡红鲜明，苔色薄白，苔质滋润，舌体大小适中，无齿痕、裂纹、点刺等异常表现。根据中医舌诊理论，淡红舌为气血调和之象，薄白苔为胃气正常、病邪未入里之征，整体反映脏腑功能协调，营卫调和，无明显寒热虚实偏颇。此为健康舌象，提示机体阴阳平衡，正气充足。\",\n  \"suggestions\": \"1. 饮食建议：保持饮食均衡，宜清淡为主，多食新鲜蔬菜水果，如苹果、梨、胡萝卜等，避免过食辛辣、油腻、煎炸食物；适量摄入优质蛋白，如鱼类、瘦肉、豆制品。2. 中药方剂：无需用药，可适当饮用菊花茶、枸杞水以助养生。3. 生活方式：维持规律作息，避免熬夜，适度运动如散步、太极拳，保持心情舒畅，避免情绪波动过大。注意季节变化，适时增减衣物，预防外感。\"\n}', '2026-01-03 00:05:05', NULL, NULL, NULL, 0, NULL, NULL);
